import React from 'react';
import './register.scss';
import { RegisterBg } from '../../assets';

const Register = () => {
  return (
    <div className='main-page'>
        <div className='left'>
          <Image src={RegisterBg} className="bg-image" />
        </div>
        <div className='right'>
          <p>Right</p>
        </div>
    </div>
  )
}

export default Register
